arguments.schema:
{
  "type": "object",
  "title": "Member Type",
  "description": "Member type with personal information and hobby details",
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at", "deleted_at"],
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Unique identifier for the member"
    },
    "name": {
      "type": "string",
      "description": "Full name of the member"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Email address of the member"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Age of the member (must be between 20 and 100)"
    },
    "hobbies": {
      "type": "array",
      "items": {
        "type": "object",
        "required": ["id", "name"],
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier for the hobby"
          },
          "name": {
            "type": "string",
            "description": "Name of the hobby"
          }
        },
        "description": "Individual hobby information"
      },
      "description": "List of member's hobbies"
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was created"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was last updated"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null",
          "description": "Indicates the member is not deleted"
        },
        {
          "type": "string",
          "format": "date-time",
          "description": "Timestamp when the member was deleted"
        }
      ],
      "description": "Soft deletion timestamp"
    }
  }
}

